UPDATE h SET AdValoremRate = h.AdValoremRate - 0.075
FROM tmdRelatedHts rh
JOIN tmdHTS h ON h.HtsIndex = rh.HtsIndex AND h.PartnerID = rh.PartnerID
JOIN tmdHTS h99 ON h99.HtsIndex = rh.HtsIndex99 AND h99.PartnerID = rh.PartnerID
WHERE REPLACE(h99.HtsNum, '.', '') = '99038815' AND h99.AdValoremRate = 0.15 AND h.AdValoremRate >= 0.15

UPDATE tmdHTS
SET AdValoremRate = 0.075
WHERE REPLACE(HtsNum, '.', '') = '99038815' AND AdValoremRate = 0.15

UPDATE tmdHTS_Section301
SET EndEffDate = '2/13/2020'
WHERE List = 4 AND AdvaloremRate = .15 AND Chapter99 = '99038815' AND EndEffDate > GETDATE() AND CountryOfOrigin = 'CN'

--need insert query for data from the spreadsheet
DECLARE @tmdHTS_Section301 AS TABLE
(
	htsnum VARCHAR(12),
	[status] VARCHAR(500),
	Chapter99 VARCHAR(10),
	CountryofOrigin VARCHAR(2),
	StartEffDate DATETIME,
	EndEffDate DATETIME,
	AdvaloremRate NUMERIC(38, 20),
	List INT
);



MERGE tmdHTS_Section301 hts USING @tmdHTS_Section301 temp
ON (hts.htsnum = temp.htsnum AND hts.[status] = temp.[status] AND hts.Chapter99 = temp.Chapter99 AND hts.CountryofOrigin = temp.CountryofOrigin
	AND hts.StartEffDate = temp.StartEffDate AND hts.EndEffDate = temp.EndEffDate AND hts.AdvaloremRate = temp.AdvaloremRate AND hts.List = temp.List)
WHEN NOT MATCHED BY TARGET
    THEN INSERT (htsnum, [status], Chapter99, CountryofOrigin, StartEffDate, EndEffDate, AdvaloremRate, List)
       VALUES (temp.htsnum, temp.[status], temp.Chapter99, temp.CountryofOrigin, temp.StartEffDate, temp.EndEffDate, temp.AdvaloremRate, temp.List);